import { VSwitch } from 'vuetify/lib'

export default {
  extends: VSwitch,
  props: {
    inset: {
      type: Boolean,
      default: true,
    },
    dense: {
      type: Boolean,
      default: true,
    },
    hideDetails: {
      type: Boolean,
      default: true,
    },
  },
}
